import * as React from 'react';
import { withRouter } from 'next/router';

import Adventures from '../../components/containers/Adventures';
import { Experiences } from '../../components/containers/Experiences';

const components = [
  { page: 1, componentarray: [Adventures] },
  { page: 2, componentarray: [Experiences] }
];

const id = ({ router }) => {
  console.log(router.query.id);
  return (
    <>
      {components[router.query.id].componentarray.map((component) => {
        return component;
      })}
    </>
  );
};

export default withRouter(id);
